from django.db import modelsfrom apps.dashboard.models import *class CoreSetting(models.Model):	dashboard_url = models.CharField(max_length=255, default='/dashboard')	stripe_secret_key = models.CharField(max_length=255, null=True)	stripe_publishable_key = models.CharField(max_length=255, null=True)	stripe_default_dealer_plan_id = models.CharField(max_length=255, null=True)	stripe_default_trader_plan_id = models.CharField(max_length=255, null=True)	stripe_default_user_plan_id = models.CharField(max_length=255, null=True)	nexmo_api_key = models.CharField(max_length=255, null=True)	nexmo_api_secret = models.CharField(max_length=255, null=True)	nexmo_phone_number = models.CharField(max_length=255, null=True)	mailgun_api_endpoint = models.CharField(max_length=255, null=True)	mailgun_api_key = models.CharField(max_length=255, null=True)	mailgun_api_email = models.CharField(max_length=255, null=True)	default_signup_status = models.CharField(max_length=255, null=True)	default_signup_level = models.CharField(max_length=255, null=True)	frontend_website = models.CharField(max_length=255, null=True)	aws_access_user = models.CharField(max_length=255, null=True)	aws_access_key_id = models.CharField(max_length=255, null=True)	aws_secret_access_key = models.CharField(max_length=255, null=True)	aws_storage_bucket_name = models.CharField(max_length=255, null=True)	aws_cloud_front_url = models.CharField(max_length=255, null=True)	aws_s3_url = models.CharField(max_length=255, null=True)	use_cdn = models.NullBooleanField(null=False, default=False)	is_active = models.NullBooleanField(null=False, default=False)	class Meta:		db_table = 'core_settings'